    public static void gcd(int []arr)
    {
        int result=0, flag=0;
        for(int i=0; i<arr.length; i++)
        {
            result=gcdcal(result, arr[i]);
            //System.out.println("result: "+result);
            if(result==1)
            {
                flag=1;
                System.out.println(1);
                break;
            }
        }

        if(flag==0)
        {
            //count the factor of that no.
            int c=1;
            for(int i=1; i<result; i++)
            {
                if((result%i)==0)
                ++c;
            }
            System.out.println(c);
            //System.out.println(result);
        }
    }
    public static int gcdcal(int a, int b)
    {
        if(a==0)
        return b;
        return gcdcal(b%a, a);
    }
